import React from 'react';
import resume from '../img/resume.transparent.png';


function ResumePage() {
    return (
        <div className="ResumePage">
            <div className="resume">
                <img src={resume} alt="resume"/>
            </div>

        </div>
    )
}

export default ResumePage
